$(function() {

	$('#myTab a').click(function (e) {
	  e.preventDefault();
	  $(this).tab('show');
	});
	
	$("img.lazy").lazy();

	$('a[href="#"][data-top!=true]').livequery('click', function(e){
		e.preventDefault();
	});

	$('[rel="tooltip"],[data-rel="tooltip"],.show_tooltip').tooltip({"placement":"bottom",delay: { show: 100, hide: 200 }});
	$('[rel="tooltip-top"],[data-rel="tooltip-top"],.show_tooltip_top').tooltip({"placement":"top",delay: { show: 100, hide: 200 }});
	$('[rel="popover"],[data-rel="popover"]').popover({placement:'left'});

	$('.cleditor').cleditor({
                width:        '100%', // width not including margins, borders or padding
                height:       500,
                controls:     // controls to add to the toolbar
                        "bold italic underline strikethrough subscript superscript | font size " +
                        "style | color highlight removeformat | bullets numbering | outdent " +
                        "indent | alignleft center alignright justify | undo redo | " +
                        "rule link unlink | cut copy paste pastetext | print source",
                colors:       // colors in the color popup
                        "FFF FCC FC9 FF9 FFC 9F9 9FF CFF CCF FCF " +
                        "CCC F66 F96 FF6 FF3 6F9 3FF 6FF 99F F9F " +
                        "BBB F00 F90 FC6 FF0 3F3 6CC 3CF 66C C6C " +
                        "999 C00 F60 FC3 FC0 3C0 0CC 36F 63F C3C " +
                        "666 900 C60 C93 990 090 399 33F 60C 939 " +
                        "333 600 930 963 660 060 366 009 339 636 " +
                        "000 300 630 633 330 030 033 006 309 303",
                fonts:        // font names in the font popup
                        "Arial,Arial Black,Comic Sans MS,Courier New,Narrow,Garamond," +
                        "Georgia,Impact,Sans Serif,Serif,Tahoma,Trebuchet MS,Verdana",
                sizes:        // sizes in the font size popup
                        "1,2,3,4,5,6,7",
                styles:       // styles in the style popup
                        [["Paragraph", "<p>"], ["Header 1", "<h1>"], ["Header 2", "<h2>"],
                        ["Header 3", "<h3>"],  ["Header 4","<h4>"],  ["Header 5","<h5>"],
                        ["Header 6","<h6>"]],
                useCSS:       false, // use CSS to style HTML when possible (not supported in ie)
        });

	$(".datepicker").datepicker();

	$(".x_popup_submit").on('click', function() {

		$this_div
			.attr('disabled', 'disabled')
			.addClass('disabled');

		$.ajax({
			type: 'post',
			url: $this_div.data('url'),
			dataType: 'json',
			data: $this_div.data(),
			success: function(data) {
		
				if(data.x_response == 'success') {
					if(data.x_url != '#') {
						window.location.href = data.x_url;
					}
					else {
						window[data.x_callback](data);
					}
				}
				else {
	
				}

				$this_div.attr('disabled', false).removeClass('disabled');

			}
		});

	});
	
	show_success_message();

	$("[id^='x_popup_load_']").livequery('click', function() {
		//$("html, body").scrollTop(0);
		var $this_div = $("#" + $(this).attr('id'));
		var popup_name = $(this).attr('id').replace('x_popup_','');
		var $modal = $('#x_popup_div');
		//GlobalModalManager.loading();
		$.get($this_div.data('url') , $this_div.data(), function(x_html) {
			$modal.html( x_html ).modal('show');
		});
	});

	$(".display_tooltip").tooltip({
		'placement': 'top'
	});
	$(".display_popover").popover({
		'trigger': 'hover',
		'placement': 'top'
	});

	$(".confirm-dialog, .confirm_dialog").click(function () {
		if($(this).data('style') == 'ajax') {
			style = 'ajax';
		}
		else {
			style = 'normal';
		}

		if(!$(this).data('callback')) {
			$(this).data('callback', '');
		}
		
		confirmation_dialog( style, $(this).data('title'), $(this).data('body'), $(this).data('url'), $(this).data('callback'), $(this) );
	});

	if(section) {
		
		if($("li[id^='subnav_" + section + "']").length) {

			$("li[id^='subnav_" + section + "']").addClass('active');

		}

	}
	
	$( "#global_search, #global_search_mobile" ).select2({
		placeholder: "Search...",
		minimumInputLength: 3,
		ajax: {
			type: 'post',
			url: "/search/all_plus_rankings",
			dataType: 'json',
			data: function (term) {
				return {
					q: term,
					no_user: 'true'
				};
			},
			results: function (sr) {
				return {results: sr.results};
			}
		},
		initSelection : function (element, callback) {
			var data = {id: element.val(), text: element.val()};
			callback(data);
		},
		dropdownCssClass: "bigdrop",
		maximumSelectionSize: 10,
		multiple: true,
		escapeMarkup: function (m) { return m; },
		formatSelection: function( sr ) {
			window.location.href = sr.link;
			return '<i class="fa fa-spinner fa-spin"></i> &nbsp;&nbsp;&nbsp;';
		},
		formatResult: function( sr ) {
			var sub;
			//output = '<div class="global-search-image"><span><img src="' + sr.photo + '" width="50" height="50"></span></div><div class="global-search-name">&nbsp; ' + sr.name + '</div>';
			if(sr.sub) {
				sub = '<li class="small">' + sr.sub + '</li>';
			}
			else {
				sub = '';
			}
			output = '<div><table class="blanktable" style="width:250px !important;"><tbody><tr><td width="55" height="50"><img src="' + sr.photo + '" width="50" height="50"></td><td><ul class="list-unstyled search-results"><li><strong>' + sr.name + '</strong></li>' + sub + '</ul></td></tr></tbody></table></div>';
			return output;
		}

	});

	$(".change_discipline").click(function() {
		$.post('/discipline/change', { discipline: $(this).data('discipline') }, function(data) {
			window.location.reload();
		});
	});

});


function country_dropdown( field_name, iso, country_code, phone_number, focus_element ) {

	focus_element = typeof focus_element !== 'undefined' ? focus_element : true;

	$(function() {
		$("#" + field_name + '_name').html( '<img src="/assets/img/flags/' + iso + '-16.png"> ' + country_code );
		$("#" + field_name + '_value').val( iso );
		$("#" + field_name + '_country_code').val( country_code );
		if(focus_element) { $("#" + field_name).focus(); }
		$("#" + field_name).val(phone_number);
	});

}

function show_message( subject, message, type, timeout ) {

	timeout = typeof timeout !== 'undefined' ? timeout : false;

	if(timeout) {
		modal = false;
	}
	else {
		modal = true;
	}

	if(message != '') {
		$("#x_success_message").text( message );
	}

	$(function() {

		if($("#x_success_message").text() != '') {

			var n = noty({
				text: '<strong>' + subject + '</strong> <br /> ' + $("#x_success_message").text(),
				type: type,
				layout: 'topRight',
				closeWith: ['fade'],
				timeout: timeout,
				modal: modal
			});
		
		}

	});

}

function show_success_message( message ) {

	if(message != '') {
		$("#x_success_message").text( message );
	}

	$(function() {

		if($("#x_success_message").text() != '') {
			
			$.noty.closeAll();

			var n = noty({
				text: '<strong>Success!</strong> <br /> ' + $("#x_success_message").text(),
				type: 'success',
				layout: 'topRight',
				closeWith: ['fade'],
			});
		
		}

	});

}

function preload(arrayOfImages) {
    $(arrayOfImages).each(function(){
        $('<img/>')[0].src = this;
    });
}

preload([
    '/assets/img/loading.gif'
]);

function loader() {

	return '<i class="fa fa-spinner fa-spin"></i>';

}

function confirmation_dialog(style, title_txt, body_txt, url, callback, elem ) {

	$(function() {
		
		$("#cd_title").text(title_txt);
		$("#cd_body").text(body_txt);
		
		if(style == 'ajax') {
			$("#cd_url").attr('href', '#');
			$("#cd_url").data('dismiss', 'modal');
			$("#cd_url").attr('aria-hidden', 'true');
			$("#cd_url").bind('click', function() {
				$.get(url, function() {
					window[callback]( elem );
					$("#confirmation_dialog").modal('hide');
				});
			});
		}
		else {
			$("#cd_url").attr('href', url);
			$("#cd_url").data('dismiss', '');
			$("#cd_url").attr('aria-hidden', 'false');
			$("#cd_url").attr('onclick', '');
		}
		
		$("#confirmation_dialog").modal('show');
	
	});
}


